import React, { Component } from 'react'
import "./no_of_sem.css"
import { Button } from 'antd';

class no_of_sem extends Component {

    sem= this.state.sems;

    constructor(props) {
        super(props)

        this.state = {
            sems: ""
        }
    }
    handleSemsChange = (event) => {
        this.setState({
            sems: event.target.value
        });
    }
    
    handleSubmit=(e)=>{
        var sem=this.state.sems;
    }
    render() {
        return (
            <form onSubmit={this.handleSubmit}>
                <div className="title">
                    <label >
                        <h3>Number of Semesters:</h3>
                    </label>
                    <input type="text" value={this.state.sems} onChange={this.handleSemsChange} />
                    <div>
                        <Button  type="primary">Go</Button>
                        <p>{this.state.sems}</p>
                    </div>
                </div>

            </form>
        )
    }
}

export default no_of_sem
